function tpgbwpForm(e){const o=e.querySelectorAll(".tpgb-wp-form");o.forEach(e=>{e.querySelectorAll(".wpforms-field.wpforms-field-checkbox .wpforms-field-label-inline").forEach(e=>{const o=document.createElement("span");o.className="tpgb-wp-check",o.innerHTML="<i class='fa fa-check'></i>",e.insertBefore(o,e.childNodes[0])}),e.querySelectorAll(".wpforms-field.wpforms-field-radio .wpforms-field-label-inline").forEach(e=>{const o=document.createElement("span");o.className="tpgb-wp-radio",o.innerHTML="<i class='fa fa-check'></i>",e.insertBefore(o,e.childNodes[0])})})}document.addEventListener("DOMContentLoaded",e=>{tpgbwpForm(document)});